$(document).ready(function (){
	$("#submitUser").submit(function(e){
		e.preventDefault();
		var input = $("#user").val();
		
		$.each(db, function(i, val){
			if (val[0].username.toLowerCase() === input.toLowerCase()){
				input = val[0].username;
				return false;
			}/*else if (val[0].alt_name.toLowerCase() === input.toLowerCase()){
				input = val[0].alt_name;
				return false;
			}*/
		});
		var user = db[input];
		if (user != null){
			console.log(user);
			$(".treeview").append(createLi(user[0], "rgb(33, 37, 41)"));
			if(user[0].influences.length > 0){
				var $ul = $("<ul>");
				var influences = makeInfluences(user[0].influences);
				
				$.each(influences, function(i, influence){
					$ul.append(createLi(influence, getNewColor("rgb(33, 37, 41)")));
				});
				
				$(".treeview").children("li").append($ul);
			}else{
				createAlert("No info from "+ user.username);
			}

			$("#user").val("");
		}else{
			createAlert("User not found");
		}
	});
});

function createLi(user, previousColor){
	var newColor = getNewColor(previousColor);

	var $flag = $("<span>", {
		"class" : "flag-icon flag-icon-"+user.country.toLowerCase()
	});

	var $linkIcon = $("<i>", {
		"class" : "fas fa-angle-double-right"
	});

	var $profileLink = $("<a>", {
		"href" : "https://osu.ppy.sh/users/"+user.userId+"#beatmaps",
		"target" : "'_blank",
		"class" : "profileLink",
		"style" : "display:none",
	});

	$profileLink.append($linkIcon);
	
	var $text = $("<span>", {
		"class" : "li-text",
		"text" : " "+user.username+" ",
		"click" : function(e){
			e.stopPropagation();
			//console.log($(this).closest("li"));
			if ($(this).parent().children("ul").length > 0){
				$(this).parent().children("ul").slideToggle("fast");
			}else{
				console.log(db[user.username][0].influences);
				if(db[user.username][0].influences.length > 0){
					var $ul = $("<ul>");
					var influences = makeInfluences(db[user.username][0].influences);
					
					$.each(influences, function(i, influence){
						$ul.append(createLi(influence, newColor));
					});
					
					$(this).closest("li").append($ul);
				}else{
					createAlert("No info from "+ user.username);
				}
			}

		}
	});

	var $li = $("<li>", {
		"style" : "color:"+newColor,
		"mouseover" : function(e){
			e.stopPropagation();
			$(this).children("a").show();
		},
		"mouseout" : function(e){
			e.stopPropagation();
			$(this).children("a").hide();
		}
	});

	$li.prepend($flag);
	$li.append($text);
	$li.append($profileLink);

	return $li;
}

function makeInfluences(userIds){
	var $arrLi = [];

	$.each(userIds, function(i, userId){
		$arrLi.push(db[userId][0]);
	});

	return $arrLi;
}

function getNewColor(color){	
	switch(color){
		case "rgb(33, 37, 41)":
			return "rgb(33, 37, 40)";
		case "rgb(33, 37, 40)":
			return "rgb(125, 0, 0)";
		case "rgb(125, 0, 0)":
			return "rgb(175, 55, 0)";
		case "rgb(175, 55, 0)":
			return "rgb(186, 121, 0)";
		case "rgb(186, 121, 0)":
			return "rgb(34, 147, 25)";
		case "rgb(34, 147, 25)":
			return "rgb(0, 112, 100)";
		case "rgb(0, 112, 100)":
			return "rgb(69, 52, 119)";
		case "rgb(69, 52, 119)":
			return "rgb(196, 90, 147)";
		case "rgb(196, 90, 147)":
			return "rgb(125,0,0)";				
		default:
			return "rgb(125, 0, 0)";
	}
}

function createAlert(message){
	var $div = $("<div>", {
		"id" : "infoBox",
		"class" : "alert alert-warning alert-dismissible fade show alert-fixed",
		"text" : message
	});

	var $button = $("<button>", {
		"type" : "button",
		"class" : "close",
		"data-dismiss" : "alert"
	});

	var $span = $("<span>", {
		"html" : "&times;"
	});

	$button.append($span);
	$div.append($button);

	$div.appendTo("body").fadeTo(1200, 1).slideUp(500, function(){
		$(this).alert("close")
	});
}